      axios
        .get(
          `http://openapi.data.go.kr/openapi/service/rest/Covid19/getCovid19SidoInfStateJson?serviceKey=et+HzIp9xULbk7BU/07ziyDd9rkLsS6ZqNDwPfF7v7a7XjnjWuyUqp9QZvicWD/o1KZr3YmtyXkQAtnpqgqX9Q==`
        )
        .then((response) => console.log(response.data.response));
    };
    getAPI();
  }, []);
  return <div></div>;
}

export default App;
